import {useEffect} from "react";

// ACTION
import * as StockAction from '../action/StockAction'

export default function MainContainer() {
    let stockDataList
    useEffect(() => {
        stockDataList = StockAction.getStockRecommendList()
    }, [])
    return (
        <>
            {stockDataList}
        </>
    )
}
